import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class ValidateService {

  constructor() { }

  validateRegister(user: any)
  {
      if(user.username == undefined || user.password == undefined || user.firstname == undefined || user.lastname == undefined){
            return false
      }
      else{
        return true;
      } 

  }
}
